    <style type="text/css">
        @import url('https://fonts.googleapis.com/css2?family=Inter&display=swap');
        html {
            -webkit-box-sizing: border-box;
            box-sizing: border-box;
            -moz-box-sizing: border-box;
            height: 100%
        }

        *,
        :before,
        :after {
            -webkit-box-sizing: inherit;
            box-sizing: inherit;
            -moz-box-sizing: inherit
        }

        * {
            box-sizing: border-box;
            outline: none;
            margin: 0;
            padding: 0;
        }

        input {
            border: none;
            outline: none;
        }

        a {
            text-decoration: none;
            outline: none;
            color: inherit
        }

        body {
            font-family: 'Inter';
            font-weight: 400;
            height: 100%;
            direction: ltr;
            text-align: center;
            color: #fff;
            background: #000;     
        }
        header img{
                position: absolute;
    top: 0;
    left: 0;
        }
        .age{
    height: 40px;
    float: right;
    right: 0;
    padding: 7px 5px;
    border: 2px solid #fff;
    width: 40px;
    border-radius: 50px;
    top: 0;
    position: absolute;
    margin: 15px;
        }
        .top_txt{
            padding-top: 65px;
        }
        main img{
            width: 100vw;
        }
        h1{
            /*font-size: 23px;*/
                font-size: 5.75vw;
            font-weight: bold;
        }
        h2{
            /*font-size: 20px;*/
                font-size: 5vw;
            font-weight: 500;
            margin-bottom: 15px;
        }
        .btn{
    width: calc(100vw - 20vw);
    margin: 0 auto;
    background: #9A57DB;
    box-shadow: 0 4px 2px 0 #3e1c66;
    border-radius: 500px;
    height: 18vw;
    line-height: 17vw;
    color: #fff;
    /* font-size: 28px; */
    font-size: 7vw;
    font-weight: bold;
    padding: 0 50px 0 0;
    margin: 15px auto;
    border: 0;
        }
                .btn img{
    width: 13vw;
    padding: 3vw 0 0 1vw;
    position: absolute;
        }
        .close{
            border: 1px solid #fff;
            width: calc(100vw - 70vw);
            margin: 0 auto;
            border-radius: 50px;
            padding: 4px 0;
            /*font-size: 16px;*/
            font-size: 4vw;
            font-weight: normal;
        }
        footer{
            position: absolute;
    bottom: 10px;
    padding-top: 5px;
    border-top: 1px solid #323232;
        }
        h3{
            /*font-size: 14px;*/
            font-size: 3.5vw;
            font-weight: normal;
            color: #D6D6D6;
        }
        a{
            text-decoration: underline;
            color: #D6D6D6;
        }
        @media (orientation: portrait) and (max-width: 360px) and (max-height: 570px) {
            .age {
    height: 30px;
    padding: 3px 0px;
    width: 30px;
    margin: 8px;
    font-size: 14px;
}
header img {
    width: 40%;
}
.top_txt {
    padding-top: 45px;
}
h2{
      margin-bottom: 10px;  
}
.btn{
    margin: 10px auto;
}
        }
        @media only screen and (orientation: landscape) {
          main img{
            display: none;
          }  
          .btn img{
            display: inherit;
                width: 13vh;
    padding: 3vh 0 0 1vh;
          }
/*          .age{
                height: 40px;
    padding: 7px 5px;
    border: 2px solid #fff;
    width: 40px;
    border-radius: 50px;
    top: 0;
    position: absolute;
    margin: 15px;
          }*/
          h1{
                font-size: 5.75vh;
          }
          h2{
    font-size: 5vh;
    margin-bottom: 0;
          }
          .btn{
                width: calc(100vw - 50vw);
    margin: 0 auto;
    height: 18vh;
    line-height: 17vh;
    /* font-size: 28px; */
    font-size: 7vh;
    padding: 0 50px 0 0;
    margin: 15px auto;
          }
          .close{
                width: calc(100vw - 80vw);
    margin: 0 auto;
    padding: 4px 0;
    /* font-size: 16px; */
    font-size: 4vh;
          }
          h3{
    font-size: 3.4vh;
    font-weight: normal;
    color: #D6D6D6;
    width: 100vw;

          }
          .age {
    height: 30px;
    padding: 3px 1px;
    width: 30px;
    margin: 10px;
    font-size: 14px;
}
header img{
        width: 20%;
}
.top_txt{
    padding-top: 45px;
}
        }
    </style>
